  Checkbox,
  FormControlLabel,
  FormGroup,
  Radio,
  RadioGroup,
  Typography,
} from "@mui/material";
import React from "react";

const PriceRadio = () => {
  const prices = [
    {
      id: 0,
      name : "Upto Rs.1000",
      value : [0,1000]
    },
    {
      id: 1,
      name : "Rs.1000-10000",
      value : [1001,10000]
    },
    {
      id: 2,
      name : "10000-50000",
      value : [10001,50000]
    },
    {
      id: 3,
      name : "50000-100000",
      value : [50001,100000]
    },
    {
      id: 4,
      name : "Rs.100001-1000000",
      value : [100001,100000000]
    }
  ];
  return (
    <>
      <Typography
        variant="h4"
        color="secondary"
        fontWeight="bold"
        marginTop="20px"
      >
        Product Price
      </Typography>

    </>
  );
};

export default PriceRadio;
